import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import styled from "styled-components";
import AOS from "aos";
import { useEffect } from "react";

// Use Material UI's `AppBar` with the theme
const TopBar = styled(AppBar)(({ theme }) => ({
  background: theme.palette.primary.main, // This will now work
}));

const NavbarText = styled(Typography)(({ theme }) => ({
  fontFamily: theme.typography.fontFamily,
}));

export default function Navbar() {
  useEffect(() => {
    AOS.init({
      duration: 2000,
    });
  }, []);

  return (
    <Box>
      <TopBar>
        <NavbarText>Summer Sale All Swim Suits And Free Express Delivery - OFF 50%! ShopNow</NavbarText>
      </TopBar>
    </Box>
  );
}
